INSERT INTO `objectclass` VALUES ('01 General',,NULL,1),('01 Scope',,NULL,1),('02 Normative References',,'There are no normative references cited for this document.  This clause is included in order to retain  clause numbering identical with other ISO management system standards. ',1),('02 Plan',,NULL,1),('03 Do',,NULL,1),('03 Terms and Definitions',,'For the purposes of this document, the following terms and definitions apply.\n\nISO and IEC maintain terminological databases for use in standardization at the following addresses:\nÔÇó    IEC Electropedia: available at http://www.electropedia.org/\nÔÇó    ISO Online browsing platform: available at http://www.iso.org/obp\n\nNOTE:  For alphabetical order of terms see the Alphabetical List of terms. ',1),('04 Check',,NULL,1),('04 Context of the Organization',,NULL,1),('05 Act',,NULL,1),('05 Leadership',,'',1),('06 Planning',,NULL,1),('07 Support',,NULL,1),('08 Operation',,NULL,1),('09 Performance Evaluation',,NULL,1),('10 Improvement',,NULL,1),('10.1 Nonconformity and Corrective Action',,'When a nonconformity is identified occurs, the organization shall:  \na) react to the nonconformity and, as applicable:  \n1. take action to control and correct it;  \n2. deal with the consequences;  \nb) evaluate the need for action to eliminate the cause(s) of the nonconformity, in order that it does  not recur or occur elsewhere, by:   \n1. reviewing the nonconformity;  \n2. determining the causes of the nonconformity;  \n3. determining if similar nonconformities exist, or could can potentially occur;  \nc) implement any action needed;  \nd) review the effectiveness of any corrective action taken;  \ne) make changes to the EnMS, if necessary.  \nCorrective actions shall be appropriate to the effects of the nonconformities encountered.    \nThe organization shall retain documented information as evidence of:  \n´é¥ the nature of the nonconformities and any subsequent action taken;  \n´é¥ the results of any corrective action. ',1),('10.2 Continual Improvement',,'The organization shall continually improve its energy performance. The organization shall continually  improve the suitability, adequacy and effectiveness of the EnMS.   ',1),('3.1 Terms related to the Organization',,NULL,1),('3.2 Terms related to the Management System',,NULL,1),('3.3 Terms related to Requirement',,NULL,1),('3.4 Terms related to Performance',,NULL,1),('3.5 Terms related to Energy',,NULL,1),('4 Energy Management System',,'The organization shall establish, implement, maintain and continually improve an the EnMS and its  energy performance an energy management system, including the processes needed and their  interactions, in accordance with the requirements of this document.    \nNOTE:  The processes required can differ from one organization to another due to:  ÔÇöthe size of organization and its type of activities, processes, products and services;  ÔÇöthe complexity of processes and their interactions;  ÔÇöthe competence of persons. ',1),('4.1 Understanding the Organization and its Context',,'The organization shall determine external and internal issues that are relevant to its purpose and that  affect its ability to achieve the intended outcome(s) of its EnMS and to improve its energy performance.   \nWhen determining organizational context, the organization shall consider the information obtained  from the energy review (see 6.3). ',1),('4.2 Understanding the Needs and Expecations of interested parties',,'The organization shall determine:  \na) the interested parties that are relevant to energy performance and the EnMS ;  \nb) the risk and opportunities for deviating from energy performance;  \nc) the relevant requirements of these interested parties;  \nd) which of the identified needs and expectations the organization addresses through its EnMS.  \nThe organization shall:  \n´é¥ ensure that it has access to the applicable legal and other requirements related to its energy  use, energy consumption, and energy efficiency;  ´é¥ determine how these requirements apply to its energy use, energy consumption, and energy  efficiency;   ´é¥ ensure that these requirements are taken into account;  ´é¥ review at defined intervals its legal and other requirements.    \nNOTE:  See ISO 19600 for additional guidance.   ',1),('4.3 Determining the Scope and Boundaries of the Energy Management System',,'The organization shall determine the boundaries and applicability of the EnMS to establish its EnMS  scope.   \nWhen determining this the EnMS scope, the organization shall consider:  \na) the external and internal issues referred to in 4.1;  \nb) the requirements referred to in 4.2.  \n\nThe organization shall ensure that it has the authority to control its energy use, energy consumption,  and energy efficiency within the scope and boundaries.  The EnMS scope and boundaries shall be  available maintained as documented information (see 7.5). ',1),('5.1 Leadership and Commitment',,NULL,1),('5.2 Energy Policy',,NULL,1),('5.3 Organization Roles, Responsibilities and Authorities',,'Top management shall ensure that the responsibilities and authorities for relevant roles are assigned  and communicated within the organization.  \nTop management shall assign the responsibility and authority to the energy management team for:  \na) ensuring the EnMS is established, implemented, maintained and continually improved;  \nb) ensuring that the EnMS conforms to the requirements of this document;  \nc) implementing action plans (see 6.6.3) to continually improve energy performance;    \nd) reporting on the performance of the EnMS and improvement of the energy performance to top  management at determined intervals;    \ne) establishing criteria and methods needed to ensure that the operation and control of the EnMS  are effective.',1),('6.1 General',,'Planning shall consist of a review of the organization\'s activities and processes that can affect energy  performance. Planning shall be consistent with the energy policy (see 5.2) and shall lead to actions that  result in continual improvement of energy performance. The organization shall maintain documented  information on the planning process.  \nNOTE 1 A concept diagram illustrating the energy planning process is shown in Figure A.1.  \nNOTE 2 The output of the energy review is used to identify risks and opportunities in the integrated management  in the organization and input of subsequent energy planning process. ',1),('6.2 Actions to Address Risks and Opportunities',,'6.2.1 When planning for the EnMS, the organization shall consider the issues referred to in 4.1, 4.2, and  outputs of energy review (see 6.3) and determine the risks and opportunities that need to be addressed  to:  \n´é¥ give assurance that the EnMS can achieve its intended outcome(s) including energy  performance improvement;  \n´é¥ prevent, or reduce, undesired effects;  \n´é¥ achieve continual improvement in the EnMS and energy performance. \n \n6.2.2 The organization shall plan:  \na) actions to address these risks and opportunities;  \nb) how to:  \n1. integrate and implement the actions into its XXX management system processes;  \n2. evaluate the effectiveness of these actions. ',1),('6.3 Energy Review',,NULL,1),('6.4 Energy Performance Indicators',,'The organization shall determine EnPIs that are appropriate for measuring and monitoring its energy performance and enable the organization to demonstrate energy performance improvement. The method for determining and updating the EnPIs shall be maintained as documented information. Where the organization has data indicating that relevant variables significantly affect energy performance, consideration of relevant variables and static factors is appropriate.  \nEnPI values shall be reviewed and compared to their respective energy baseline(s), as appropriate. EnPI value(s) shall be retained as documented information. ',1),('6.5 Energy Baseline',,'The organization shall establish an EnB(s) using the information from the energy review(s) (see 6.3), taking into account a suitable period of time.   \nEnB(s) shall be modified to enable energy performance comparison under equivalent conditions or revised in case of one or more of the following: \na) EnPI(s) no longer reflect the organizationÔÇÖs energy performance,  \nb) there have been major changes to the static factors, or \nc) according to a pre-determined method. \nWhere the organization has data indicating that relevant variables significantly affect energy performance, the organization shall carry out normalization of the EnPI(s) and corresponding EnB(s) to compare energy performance changes.  \nThe EnB(s), relevant variable data and modifications to EnB(s) shall be retained as documented information (see 7.5). ',1),('6.6 Objectives, Energy Targets and Planning to Achieve them',,NULL,1),('6.7 Planning for Energy Data Collection',,NULL,1),('7.1 Resources',,'The organization shall determine and provide the resources needed for the establishment,  implementation, maintenance and continual improvement of:  \na) the EnMS;  \nb) energy performance. ',1),('7.2 Competence',,'The organization shall:  \na) determine the necessary competence of person(s) doing work under its control that affects its  energy performance and EnMS;    \nb) ensure that these persons are competent on the basis of appropriate education, training, skills  or experience;    \nc) where applicable, take actions to acquire the necessary competence, and evaluate the  effectiveness of the actions taken;   \nd) retain appropriate documented information ( see 7.5) as evidence of competence.  \nNOTE Applicable actions can include, for example, the provision of training to, the mentoring of, or the  reassignment of currently employed persons; or the hiring or contracting of competent persons.   ',1),('7.3 Awareness',,'Persons doing work under the organizationÔÇÖs control shall be aware of:  \na) the energy policy (see 5.2);    \nb) their contribution to the effectiveness of the EnMS, including achievement of objectives and  energy targets (see 6.6) and the benefits of improved energy performance;  \nc) the impact of their activities or behaviour with respect to energy performance;  \nd) the implications of not conforming with the EnMS requirements. ',1),('7.4 Communication',,'The organization shall determine the internal and external communications relevant to the EnMS,  including:  \na) on what it will communicate;  \nb) when to communicate;  \nc) with whom to communicate;  \nd) how to communicate;  \ne) who communicates.  \nWhen establishing its communication process(es), the organization shall ensure that information  communicated is consistent with information generated within the EnMS and is reliable.    \nThe organization shall establish and implement a process by which any person working for, or on behalf  of the organization can make comments or suggest improvements to the EnMS and to energy  performance. ',1),('7.5 Documented Information',,NULL,1),('7.5.1 General',,'The organizationÔÇÖs EnMS shall include:  \na) documented information required by this document;  \nb) documented information determined by the organization as being necessary for the  effectiveness of the EnMS and to demonstrate energy performance improvement.    \nNOTE The extent of documented information for an EnMS can differ from one organization to another due to:  \nÔÇö the size of organization and its type of activities, processes, products and services;  \nÔÇö the complexity of processes and their interactions;  \nÔÇö the competence of persons. ',1),('7.5.2 Creating and Updating',,'When creating and updating documented information, the organization shall ensure appropriate:  \na) identification and description (e.g. a title, date, author or reference number);  \nb) format (e.g. language, software version, graphics) and media (e.g. paper, electronic);  \nc) review and approval for suitability and adequacy. ',1),('7.5.3 Control of Documented Information',,'Documented information required by the EnMS and by this document shall be controlled to ensure:  \na) it is available and suitable for use, where and when it is needed;  \nb) it is adequately protected (e.g. from loss of confidentiality, improper use, loss of integrity).  \nFor the control of documented information, the organization shall address the following activities, as  applicable:  \n´é¥ distribution, access, retrieval and use;  \n´é¥ storage and preservation, including preservation of legibility;  \n´é¥ control of changes (e.g. version control);  \n´é¥ retention and disposition.  \nDocumented information of external origin determined by the organization to be necessary for the  planning and operation of the EnMS shall be identified, as appropriate, and controlled.    \nNOTE Access can imply a decision regarding the permission to view the documented information only, or the  permission and authority to view and change the documented information. ',1),('8.1 Operational Planning and Control',,NULL,1),('8.2 Design',,'The organization shall consider energy performance improvement opportunities and operational control in the design of new, modified and renovated facilities, equipment, systems and energy-using processes that can have a significant impact on its energy performance over the planned or expected operating lifetime.   \nWhere appropriate, the results of the energy performance evaluation shall be incorporated into the specification, design and procurement activities.  \nThe results of the design activities shall be retained as documented information (see 7.5).   ',1),('8.3 Procurement',,'The organization shall establish and implement criteria for evaluating energy performance over the planned or expected operating lifetime when procuring energy using products, equipment and services which are expected to have a significant impact on the organization\'s energy performance. \n \nWhen procuring products, equipment, and services that have, or can have, an impact on SEUs, the organization shall inform suppliers that energy performance is one of the evaluation criteria for procurement. \nThe organization shall define and communicate specifications for: \na) ensuring the energy performance of procured equipment and services, where applicable;  b) the purchase of energy, if applicable. ',1),('9.1 Monitoring, Measurement, Analysis and Evaluation for Energy Performance and the EnMS',,NULL,1),('9.2 Evaluation of Compliance with Legal and other Requirements',,'At planned intervals, the organization shall evaluate compliance with legal and other requirements (see 4.2) related to its energy use, energy consumption, energy efficiency, and the EnMS.  The organization shall retain documented information (see 7.5) on the results of the evaluation of compliance and any actions taken.',1),('9.3 Internal EnMS Audit',,NULL,0),('9.4 Management Review',,NULL,1),('Action Plan',,NULL,0),('Action Plan Directory',,NULL,1),('Administration Directory',,'The class Administration Directory represents a specific directory for the management of administrative data.\n\nThe class is unique, which means that it is not possible to create a object of this class in parallel to an already existing object of the same class.',1),('Air Condition Equipment Directory',,'The class Air Condition Equipment Directory represents a specific directory for the management of the air conditions of an organization.\n\nThe class is unique, which means that it is not possible to create a object of this class in parallel to an already existing object of the same class.',1),('Air Conditioning',0x47494638396120002000F0000000000033333321F90401000000002C0000000020002000400247848FA9CB1D1F9A04F1C02AF1DC3CBF0E5AD5A585264842E77AA6EC6BAAE2D5CAF08DBFA90B6B650EA4D872A4A091330CFD78A8A4F08774DE3EC76A82660D32753B6AAD8B5D1400003B,'The class Air Conditioning contains data of the building equipment air condition. Attributes of the class include a complete description of the sp