e.\n',0),('Report Link Directory',,NULL,0),('Report Period Configuration',,NULL,1),('Responsibilities',,NULL,0),('Service',,'The class Service represents a JEVis back-end application which is registered at the JEVis system. A Service class provide all information for an application which interacts with the JEVis system. ',0),('Service Directory',,'The class Service Directory represents a specific directory for the management of back-end services.\n\nThe class is unique, which means that it is not possible to create a object of this class in parallel to an already existing object of the same class',1),('sFTP Channel',,NULL,0),('sFTP Channel Directory',,'The class sFTP Channel Directory represents a specific directory for the management of data.\n',0),('sFTP Server',,NULL,0),('Site',,NULL,0),('SOAP Channel',,NULL,0),('SOAP Channel Directory',,'The class SOAP Channel Directory represents a specific directory for the management of data.\n',0),('SOAP Server',,NULL,0),('SQL Channel',,NULL,0),('SQL Data Point',,NULL,0),('SQL Parser',,NULL,0),('Static Limit Alarm',,'The class Static Limit Alarm contains data of elements of an alarm with a static limit.',0),('Station',,NULL,0),('Station Directory',,NULL,1),('Superior Level Meetings Directory',,NULL,1),('System',,'JEVis Root Node whit system informations',1),('Training',,NULL,0),('Training Course',,NULL,0),('Training Course Directory',,NULL,1),('Training Directory',,NULL,1),('User',,'User to access the JEVis',0),('User Directory',,'The class User Directory represents a specific directory for the management of users.',1),('Ventilation',,'The class Ventilation contains data of the building equipment ventilation. Attributes of the class include a complete description of the specific energy data of the ventilation. ',0),('Ventilation Equipment Directory',,NULL,1),('VIDA350',,NULL,0),('VIDA350 Channel',,NULL,0),('VIDA350 Channel Directory',,'The class VIDA350 Directory represents a specific directory for the management of data.\n\nThe class is unique, which means that it is not possible to create a object of this class in parallel to an already existing object of the same class.',1),('View Directory',,'The class View Directory represents a specific directory for the management of individual views. Within a View Directory a user is able to create structures without any system limitations. The content of a View Directory is always just a link to the referred objects in the restricted part of the JEVis system. Modifications on the content of the View Directory will always affect on the referring objects.',1),('XLS Parser',,NULL,0),('XML Data Point',,NULL,0),('XML Data Point Directory',,'The class XML Data Point Directory represents a specific directory for the management of XML data.\n',0),('XML Parser',,NULL,0),('ZIP Converter',,'The Class ZIP Converter ',0);
